name: Lemon Burst Cookies
servings: 18 cookies
source: Totally Sacha
source_url: https://www.youtube.com/watch?v=s0owZFtdESk
prep_time: 10 minutes
cook_time: 10 minutes
categories: [bakery, cookies, lemon]
ingredients: |
  240g flour
  1-1/2 t baking powder 
  Zest of 1 lemon
  115g softened butter
  200g sugar
  60g confectioners sugar 
  2 eggs
  Lemon extract
  Yellow dye
directions: |
  Preheat oven to 170c
  Line cookie sheet with parchment 
  Cream butter and sugar
  Add eggs, lemon extract, dye
  Combine flour, baking powder, zest
  Add dry ingredients to creamed butter
  Drop by spoonful into confectioners sugar and coat completely 
  Place on cookie sheet
  Bake for 12 minutes 
